import React, { Component } from 'react';



export default class ChatMessage extends Component {
    render = () => {
        const {author, body} = this.props;
        return(
            <div className={"message-container"}>
                <h1 className={"user"}>
                    {"Aluno"}
                </h1>
                <p className={"message-text"}>
                    {body}
                </p>
            </div>
        )
    }
}
